import React from 'react';
import { Form, Input, Button, Card, List } from 'antd';

const Profile = () => {
    return (
        <>
            <br />
            <div>
                <Card
                title="닉네임 수정">
                <Form style={{ margin : '10px'}}>
                    <Input ></Input>
                    <Button type="primary" style={{ margin: '10px 10px', float : 'right'}}>수정</Button>
                </Form>
                </Card>
                <br />
                <List
                    title="Follow"
                    dataSource={[seoyoung, vvoojin, mind-zero]}
                    loadMore={<Button style={{ width: '100%' }}>더보기</Button>}
                    bordered
                    renderItem={item => (
                        <List.Item>
                            <List.Item.Met
                                avatar={<Avatar size={40} icon={<UserOutlined/>}/>}
                            />
                        </List.Item>
                    )}
                >

                </List>
                <Card
                    size="small"
                    title="Follow">
                </Card>
                <br />
                <Card
                    size="small"
                    title="Following">

                </Card>
            </div>
        </>
    );
};

export default Profile;
